import React from 'react';
import Image from '../assets/PSGiTech_Front_View.jpg';
import styles from '../styles/Welcome.css'

const Welcome = () => {
  return (
    <article
      className={styles.article}
      style={{ backgroundImage: `url(${Image})`, width }}
    >
      <h1 className={styles.header}>React Is Awesome</h1>
    </article>
  );
};

export default Welcome;
